import React, { useState } from "react";

export const Input2 = () => {
  const [name, setName] = useState(" ");
  const [age, setAge] = useState(" ");
  const [message, setMessage] = useState(" ");
  const handleClick = () => {
    document.getElementById("name").innerHTML = `Your Name ${name}`;
    document.getElementById("age").innerHTML = `Your Age ${age}`;
    document.getElementById("messsage").innerHTML = `Your message ${message}`;
  };
  return (
    <div>
      <input
        type="text"
        placeholder="name"
        onChange={(e) => setName(e.target.value)}
      />
      <input
        type="text"
        placeholder="Age"
        onChange={(e) => setAge(e.target.value)}
      />
      <br />
      <input
        type="text"
        placeholder="Message"
        onChange={(e) => setMessage(e.target.value)}
      />
      <button onClick={handleClick}>Submit</button>

      <h4>Your Name1 : id={name} </h4>
      <h4>Your Age2 : id={age} </h4>
      <h4>Your Message3: id={message}</h4>
    </div>
  );
};
